import React, { Component, Fragment } from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom'
import Header from './Header'

const Home = () => {
	return(
		<h1 className="bg-primary text-white text-center">Home</h1>
	)
}
const Listmembre = () => {
	return(
		<h1 className="bg-primary text-white text-center">List of membre</h1>
	)
}
const Addmembre = () => {
	return(
		<h1 className="bg-primary text-white text-center">Add membre</h1>
	)
}

class App extends Component{
	render(){
		return(
			<BrowserRouter>
				<Fragment>
					<Header  />
					<section>
						<Switch>
							<Route exact path="/" component={Home} />} />
							<Route path="/listmembre" component={Listmembre} />} />
							<Route path="/addmembre" component={Addmembre} />} />
						</Switch>
					</section>
				</Fragment>
			</BrowserRouter>
	)}
}

export default App
